biography:
John Yohan Cho is a Korean American Actor best known as playing Harold in the Harold and Kumar film series, as well as playing helmsman Hikaru Sulu in 2009's Star Trek.&nbsp;
John Cho began working after appearing as a print model for Korean Magainzes, and made his first film appearance in the 1999 raunch comedy American Pie, a film in which Cho's character popularized the now infamous term MILF. &nbsp;
